import React from 'react';
import { StyleSheet, Text, View } from 'react-native'; // These are from the react-native library

export default function App() {
  return (
    <View style={styles.container}>
      <Text>Open up App.js to start working on your app!</Text>
      <Text>What is love but just a feeling I is a great feeling Itis what everyone cares about.</Text>
    </View>
  );
}

//Inline javascript styles, unlike css script

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#0ff',
    alignItems: 'center', // This aligns items vertically
    justifyContent: 'center', //This aligns items horizontally
  },
});
